import React from 'react';
import propTypes from "prop-types"
import readedSvg from "assets/img/checked.svg"
import noReadedSvg from "assets/img/noreaded.svg"

import "./Status.scss"

const Status = (props) => {
    return 
}

Status.propTypes = {
    isMe: propTypes.bool,
    isReaded: propTypes.bool
}

export default Status;
